// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
// donor->hospital->bloodbank->patient
contract BloodSupplyChain {

    enum BloodStatus {
        Requested,
        SampleCollected,
        Tested,
        Stored,
        Transported,
        Used
    }

    struct BloodUnit {
        bytes32 donorId;
        string bloodGroup;
        BloodStatus status;
        uint timestamp;
    }

    mapping(bytes32 => BloodUnit) public bloodUnits;

    event DonationRequested(bytes32 donorId);
    event SampleCollected(bytes32 donorId);
    event BloodStored(bytes32 donorId);
    event BloodTransported(bytes32 donorId);
    event BloodUsed(bytes32 donorId);
    event BloodDonated(address donor, string hospital, uint time);

    function donateBlood(address _donor, string memory _hospital) public {
        emit BloodDonated(_donor, _hospital, block.timestamp);
    }


    function requestDonation(bytes32 donorId) public {
        bloodUnits[donorId] = BloodUnit(
            donorId,
            "",
            BloodStatus.Requested,
            block.timestamp
        );
        emit DonationRequested(donorId);
    }

    function collectSample(bytes32 donorId, string memory bloodGroup) public {
        bloodUnits[donorId].bloodGroup = bloodGroup;
        bloodUnits[donorId].status = BloodStatus.SampleCollected;
        emit SampleCollected(donorId);
    }

    function storeBlood(bytes32 donorId) public {
        bloodUnits[donorId].status = BloodStatus.Stored;
        emit BloodStored(donorId);
    }

    function transportBlood(bytes32 donorId) public {
        bloodUnits[donorId].status = BloodStatus.Transported;
        emit BloodTransported(donorId);
    }

    function useBlood(bytes32 donorId) public {
        bloodUnits[donorId].status = BloodStatus.Used;
        emit BloodUsed(donorId);
    }
}
